class Solution(object):
    def isPalindrome(self, x):
        palendrome = True
        y= str(x)
        end = len(y)-1
        count = 0
        while count < end and palendrome == True:
            if y[count] == y[end]:
                count += 1
                end -= 1
            else:
                palendrome = False
        return palendrome
