class Solution(object):
    def isPalindrome(self, s):
        palendrome = True
        y= ""
        for x in range(len(s)):
            if s[x].isalnum():
                y += s[x].lower()
        end = len(y)-1
        count = 0
        while count < end and palendrome == True:
            if y[count] == y[end]:
                count += 1
                end -= 1
            else:
                palendrome = False
        return palendrome
